import styled, { ThemeProvider } from 'styled-components';
import theme from './resource/css/theme';

function App() {
    return (
        <>
            <Btn>btn1</Btn>
            <ThemeProvider theme={theme}>
                <Btn>btn2</Btn>
            </ThemeProvider>
        </>
    );
}

const Btn = styled.button`
    background-color: ${({ theme }) => theme.colors.red};
`;

export default App;
